import React, { Fragment } from 'react'; 
import {v4 as uuidv4} from 'uuid';

const Countries = (props) => {

    return (
        <Fragment>
            <section>
                {props.countryData.map((axtra) => {
                    const resiveData = {axtra, id: uuidv4()}
                })}
            </section>
        </Fragment>
    )
}
export default Countries;
